    [],nt"num_tags": 9,nt"name": "nowitna-national-wildlife-refuge-annual-narrative-report-calendar-year-1987",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Nowtina
    NWR outlines Refuge accomplishments during the 1987 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management planning, public participation, and research and investigations. Refuge
    administration is outlined; information about personnel, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, fire management, water rights, and wilderness areas.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, fisheries resources, and marking and bird banding. The public uses
    of the Refuge described in this report include hunting, fishing, trapping, and law
    enforcement. The equipment and facilities section of the report provides information
    about rehabilitation, major maintenance, equipment replacement, and communication
    systems. Cooperative programs and items of interest are provided at the end.",nt"owner_org":
